pragma solidity >=0.4.0 <0.6.0;

import "./libExchangeStruct.sol";


library ExchangeFunc {
    // libToken newToken;
    ////////////
    // EVENTS //
    ////////////

    //EVENTS for Deposit/withdrawal
    event DepositForTokenReceived(address indexed _from, uint indexed _symbolIndex, uint _amount, uint _timestamp);

    event WithdrawalToken(address indexed _to, uint indexed _symbolIndex, uint _amount, uint _timestamp);

    event DepositForEthReceived(address indexed _from, uint _amount, uint _timestamp);

    event WithdrawalEth(address indexed _to, uint _amount, uint _timestamp);

    //events for orders
    event LimitSellOrderCreated(uint indexed _symbolIndex, address indexed _who, uint _amountTokens, uint _priceInWei, uint _orderKey);

    event SellOrderFulfilled(uint indexed _symbolIndex, uint _amount, uint _priceInWei, uint _orderKey);

    event SellOrderCanceled(uint indexed _symbolIndex, uint _priceInWei, uint _orderKey);

    event LimitBuyOrderCreated(uint indexed _symbolIndex, address indexed _who, uint _amountTokens, uint _priceInWei, uint _orderKey);

    event BuyOrderFulfilled(uint indexed _symbolIndex, uint _amount, uint _priceInWei, uint _orderKey);

    event BuyOrderCanceled(uint indexed _symbolIndex, uint _priceInWei, uint _orderKey);

    //events for management
    event TokenAddedToSystem(uint _symbolIndex, string _token, uint _timestamp);



    //////////////////////////////////
    // DEPOSIT AND WITHDRAWAL ETHER //
    //////////////////////////////////
    function _depositEther_(ExchangeStruct.DataToken storage self, uint amountInWei) internal returns (bool) {
        require(self.ethBalanceForAddress[msg.sender] + amountInWei >= self.ethBalanceForAddress[msg.sender]);
        self.ethBalanceForAddress[msg.sender] += amountInWei;
        emit DepositForEthReceived(msg.sender, amountInWei, now);
        return true;
    }

    function _withdrawEther_(ExchangeStruct.DataToken storage self, uint amountInWei) internal returns (bool) {
        require(self.ethBalanceForAddress[msg.sender] - amountInWei >= 0);
        require(self.ethBalanceForAddress[msg.sender] - amountInWei <= self.ethBalanceForAddress[msg.sender]);
        self.ethBalanceForAddress[msg.sender] -= amountInWei;
        msg.sender.transfer(amountInWei);
        emit WithdrawalEth(msg.sender, amountInWei, now);
    }

    function _getEthBalanceInWei_(ExchangeStruct.DataToken storage self) view internal returns (uint){
        return self.ethBalanceForAddress[msg.sender];
    }
}
